    "2016-07-27T22:18:24.303030",nt"name": "aquatic-plant-and-waterfowl-habitat-survey-1988-stillwater-wildlife-management-area-and-vi",nt"isopen":
    false,nt"url": null,nt"notes": "Aquatic vegetation surveys were conducted
    on Stillwater Wildlife Management Area, Canvasback Club, Carson Lake, and several
    other wetlands in Lahontan Valley, Nevada. This was the second drought year in a
    row, and wetland acreage was severely reduced. Species diversity was low on most
    wetlands, and sago pondweed was the dominant species. The greatest production of
    submerged vegetation occurred in Lower Foxtail and East Alkali #1 at Stillwater
    WMA. Old River Reservoir and S-Line Reservoir were the only other wetlands that
    produced substantial amounts of submerged vegetation.  No submerged vegetation was
    found on the major wetland units of the Canvasback Club or Carson Lake.",nt"license_title":
